import { Input,Form, Button } from "antd";
import Password from "antd/es/input/Password";
const onFinish = (data) =>{
    console.log(data);
}
const SignUp = () =>{
    return (
       <Form>
        <Input placeholder="Username" />
        <Input placeholder="password"/>
        <Button htmlType="submit"/>
       </Form>
    )
}
export default SignUp;
